using System;\nusing System.Data;\nusing System.Data.SqlClient;\n\npublic class Program\n{\n    public static void Main()\n    {\n        // Connection string to your SQL Server\n        string connString = "your_connection_string_here";\n\n        // Creating and populating the DataTable\n        DataTable dt = new DataTable();\n        DataColumn dc2 = new DataColumn();\n        dc2.DataType = typeof(string);\n        dc2.ColumnName = "strRow";\n        dt.Columns.Add(dc2);\n\n        // Sample data rows\n        DataRow dr = dt.NewRow();\n        dr["strRow"] = "AA|BBB|CC|DD|E";\n        dt.Rows.Add(dr);\n\n        dr = dt.NewRow();\n        dr["strRow"] = "A3|BB|C|DDD";\n        dt.Rows.Add(dr);\n\n        dr = dt.NewRow();\n        dr["strRow"] = "A4|GOB|BLDY|GOOK";\n        dt.Rows.Add(dr);\n\n        dr = dt.NewRow();\n        dr["strRow"] = "A5|Hello|My|Darling";\n        dt.Rows.Add(dr);\n\n        try\n        {\n            using (SqlConnection conn = new SqlConnection(connString))\n            {\n                using (SqlCommand cmd = new SqlCommand("dbo.InsertPIF", conn))\n                {\n                    cmd.CommandType = CommandType.StoredProcedure;\n\n                    SqlParameter param = new SqlParameter();\n                    param.ParameterName = "@InputFileParam";\n                    param.SqlDbType = SqlDbType.Structured;\n                    param.Value = dt;\n\n                    cmd.Parameters.Add(param);\n\n                    conn.Open();\n                    int rowsAffected = cmd.ExecuteNonQuery();\n                    Console.WriteLine("Rows affected: " + rowsAffected);\n                }\n            }\n        }\n        catch (Exception ex)\n        {\n            Console.WriteLine("Exception: " + ex.Message);\n        }\n    }\n}